$(document).ready(function() {
    $("#new_user").validate ({
        rules: {
           user_password: {
               required: true
           },
           user_email: {
               required: true,
               email: true
           }
        },
        messages: { 
            user_password: "Please provide a password",
            user_email: "Please enter a valid email address"
        },
    });
});
